$(document).ready(function(){var a=$(".counter").data("dateto");setInterval(function(){var t=new Date,o=Math.abs(a-t/1e3);console.log(a);t=Math.floor(o/86400);o-=86400*t,$("#days").html((t<10?"0":"")+t);t=Math.floor(o/3600)%24;o-=3600*t,$("#hours").html((t<10?"0":"")+t);t=Math.floor(o/60)%60;o-=60*t,$("#minutes").html((t<10?"0":"")+t);o=Math.floor(o)%60;$("#seconds").html((o<10?"0":"")+o)},1e3)});